import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <a Link>Home</a>
          </li>
          <li>
            <a href="./menu.html">Faqs</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default NavBar;
